import "./Home.css";
import { useEffect, useState } from "react";
import { useNavigate } from "react-router-dom";

function Home() {

  let navigate = useNavigate();

  return (
    <div className="homePage">
      {postList.map((post) => {
        return (
          <div
            className="post"
            key={post.id}
            onClick={() => navigatePost(post)}
          >
          </div>
        );
      })}
    </div>
  );
}

export default Home;
